INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (2, "東山奈央", 27, "トゥインクルウィッシュ", 155, 0, 100101, "ヒヨリ", 8, 16, "獣人族", "人助け、応援", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 44, "A", "人助けが大好き！　前向き格闘娘");
