INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (5, "諸星すみれ", 10, "リトルリリカル", 128, 0, 100401, "ミソギ", 8, 9, "ヒューマン", "いたずら、探検", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 27, "O", "探検好きのイタズラっ子");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (8, "下田麻美", 25, "王宮騎士団（NIGHTMARE）", 146, 0, 100501, "マツリ", 11, 12, "獣人族", "ヒーローごっこ", "？？？", 40, "O", "ヒーローに憧れる騎士見習いの少女");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (7, "浅倉杏美", 22, "悪魔偽王国軍（ディアボロス）", 150, 0, 100601, "アカリ", 11, 13, "魔族", "サックス", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 42, "O", "甘え上手なみんなの人気者");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (7, "雨宮天", 23, "悪魔偽王国軍（ディアボロス）", 130, 0, 100701, "ミヤコ", 1, 14, "魔族", "プリンを食べること", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 32, "B", "プリン大好きゴースト娘");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (15, "大空直美", 10, "ヴァイスフリューゲル　ランドソル支部", 150, 0, 100801, "ユキ", 10, 14, "エルフ", "鏡で自分を見ること", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 40, "AB", "ボクは誰よりも美しい");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (13, "髙野麻美", 5, "トワイライトキャラバン", 159, 0, 100901, "アンナ", 7, 17, "魔族", "小説執筆", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 45, "A", "前世を信じる中二病患者、「疾風の冥姫」");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (10, "内田真礼", 22, "自警団（カォン）", 155, 0, 101001, "マホ", 9, 16, "獣人族", "空想、ぬいぐるみ集め", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 42, "O", "マホマホ王国のプリンセス");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (3, "阿澄佳奈", 25, "ラビリンス", 156, 0, 101101, "リノ", 8, 15, "ヒューマン", "お裁縫", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 44, "A", "人懐っこくてマシンガントークな妹系少女");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (6, "大橋彩香", 24, "フォレスティエ", 156, 0, 101201, "ハツネ", 12, 17, "エルフ", "妹と遊ぶこと、二度寝、昼寝、早寝", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 46, "A", "みんなのために超能力を使う眠り姫");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (13, "佳村はるか", 21, "トワイライトキャラバン", 166, 0, 101301, "ナナカ", 8, 18, "魔族", "読書、魔法", "", 55, "O", "オタク全開な魔法少女");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (10, "水瀬いのり", 3, "自警団（カォン）", 152, 0, 101401, "カスミ", 11, 15, "獣人族", "読書、推理", "test", 41, "AB", "頭脳明晰な美少女名探偵");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (6, "國府田マリ子", 5, "フォレスティエ", 165, 0, 101501, "ミサト", 9, 21, "エルフ", "絵本作り", "test", 54, "O", "母性溢れる優しいみんなの「ミサト先生」");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (14, "上坂すみれ", 10, "ルーセント学院", 167, 0, 101601, "スズナ", 4, 18, "魔族", "ファッション", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 48, "O", "天真爛漫で人気者のカリスマモデル");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (10, "高森奈津美", 7, "自警団（カォン）", 158, 0, 101701, "カオリ", 7, 19, "獣人族", "踊り、空手", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 53, "A", "いつでも「なんくるないさ～」な天然娘");
