INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (5, "日高里菜", 3, "リトルリリカル", 117, 0, 102001, "ミミ", 4, 10, "獣人族", "かわいいもの集め", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 21, "O", "お歌もにんじんも、ウサギさんも大好き♪");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (9, "植田佳奈", 9, "サレンディア救護院", 150, 0, 102101, "クルミ", 6, 12, "ヒューマン", "観劇、おままごと", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 40, "B", "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (7, "原紗友里", 22, "悪魔偽王国軍（ディアボロス）", 150, 0, 102201, "ヨリ", 11, 13, "魔族", "ゲーム全般", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 40, "O", "人見知りであまのじゃくな女の子");
