INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (9, "悠木碧", 12, "サレンディア救護院", 154, 0, 102501, "スズメ", 12, 15, "ヒューマン", "ご奉仕", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 43, "O", "お嬢さまのためにがんばるドジっ娘メイド");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (11, "小岩井ことり", 1, "牧場（エリザベスパーク）", 144, 0, 102601, "リン", 1, 17, "獣人族", "あんパン", "test", 42, "B", "遊びと睡眠が何より大事なぐうたら娘");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (13, "橋本ちなみ", 30, "トワイライトキャラバン", 154, 0, 102701, "エリコ", 7, 16, "魔族", "実験、裁縫、料理", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 43, "B", "運命の相手に一途すぎる乙女");
