INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (4, "日笠陽子", 24, "カルミナ", 157, 0, 102901, "ノゾミ", 1, 17, "ヒューマン", "舞台鑑賞、ダンス", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 40, "B", "歌って踊れる大人気アイドル");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (15, "佐藤聡美", 31, "ヴァイスフリューゲル　ランドソル支部", 163, 0, 103001, "ニノン", 8, 16, "ヒューマン", "忍法開発", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 51, "O", "トーゴクの神秘、オシエテクダサイ！");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (7, "大坪由佳", 22, "悪魔偽王国軍（ディアボロス）", 157, 0, 103101, "シノブ", 12, 18, "魔族", "占い", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 42, "AB", "占いが得意な霊能少女");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (12, "松嵜麗", 12, "メルクリウス財団", 157, 0, 103201, "アキノ", 3, 18, "ヒューマン", "慈善事業", "この私とともにいる限り、\nお金に不自由はさせませんわ！", 45, "AB", "一人前の商人を目指すパワフルお嬢様");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (11, "新田恵海", 3, "牧場（エリザベスパーク）", 142, 0, 103301, "マヒル", 3, 20, "ヒューマン", "漫才", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 35, "B", "みんなを笑顔にするお笑い牧場主");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (12, "今井麻美", 16, "メルクリウス財団", 164, 0, 103401, "ユカリ", 3, 22, "エルフ", "ウインドーショッピング", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 55, "A", "純情でほっとけない大人の女性");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (5, "小倉唯", 2, "リトルリリカル", 118, 0, 103601, "キョウカ", 2, 8, "エルフ", "お勉強", "test", 21, "A", "礼儀正しくしっかり者のちびっ子優等生");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (8, "茅原実里", 11, "王宮騎士団（NIGHTMARE）", 149, 0, 103701, "トモ", 8, 13, "ヒューマン", "剣術、年長者をからかう", "test", 43, "A", "義理堅くてからかい好きな剣術少女");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (11, "小清水亜美", 3, "牧場（エリザベスパーク）", 153, 0, 103801, "シオリ", 11, 14, "獣人族", "読書、お散歩", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 40, "A", "読書が趣味の病弱少女");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (6, "花澤香菜", 6, "フォレスティエ", 158, 0, 104001, "アオイ", 6, 13, "エルフ", "友達作りのイメトレ", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 44, "AB", "「友達」に憧れる、エルフの森の女の子");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (4, "福原綾香", 3, "カルミナ", 163, 0, 104201, "チカ", 6, 17, "ヒューマン", "各種楽器", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 46, "O", "人々を守るために歌う、唱喚士の少女");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (10, "小松未可子", 9, "自警団（カォン）", 168, 0, 104301, "マコト", 8, 17, "獣人族", "お菓子作り", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 54, "O", "男勝りで情に厚いワイルド娘");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (7, "丹下桜", 5, "悪魔偽王国軍（ディアボロス）", 172, 0, 104401, "イリヤ", 5, "??", "魔族", "世界征服", "test", 50, "A", "かつては夜を支配した最強の吸血鬼");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (15, "長妻樹里", 19, "ヴァイスフリューゲル　ランドソル支部", 157, 0, 104501, "クウカ", 11, 18, "ヒューマン", "小説を読むこと", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 49, "AB", "妄想大好き！　ほんとは照れ屋な女の子");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (12, "沼倉愛美", 1, "メルクリウス財団", 158, 0, 104601, "タマキ", 3, 18, "獣人族", "猫とたわむれること", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 48, "AB", "弱きを助け強きをくじく猫娘");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (8, "川澄綾子", 25, "王宮騎士団（NIGHTMARE）", 171, 0, 104701, "ジュン", 10, 25, "ヒューマン", "格闘技、湯浴み", "？？？", 50, "A", "素顔を見せない冷静沈着な女性騎士");
