INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (9, "植田佳奈", 9, "サレンディア救護院", 150, 0, 108501, "クルミ（クリスマス）", 6, 12, "ヒューマン", "観劇、おままごと", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 40, "B", "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (9, "芹澤優", 10, "サレンディア救護院", 148, 0, 108601, "アヤネ（クリスマス）", 5, 14, "ヒューマン", "屋内でできる遊び", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 38, "B", "ぷうきちといつも一緒！");
